import React from "react";

const App = () => {
  const cDate = new Date().toLocaleDateString();
  const nTime = new Time().toLocaleTimeString();
  return (
    <div>
      <h1>currentdate {cDate}</h1>
      <h2>currenttime{nTime}</h2>
    </div>
  );
};

export default App;
